import styled from "styled-components";

const Header__upper = styled.div`
  display: flex;
  justify-content: space-between;
`;

const MainLogo = styled.img`
  width: 20px;
  height: 20px;
`;
const Menus = styled.ul`
  display: flex;
  justify-content: space-evenly;
`;
const Menu = styled.li`
  font-size: 1.5rem;
  font-weight: 400;
`;

const Logined = true;

function Header() {
  if (Logined === true) {
    return (
      <Header__upper>
        <MainLogo src="../img/new_logo_nobackground.png" alt="Main Logo" />
        <Menus>
          <Menu>클럽 소개</Menu>
          <Menu>이벤트</Menu>
          <Menu>커뮤니티</Menu>
          <Menu>공지 사항</Menu>
          <Menu>문의하기</Menu>
          <Menu>마이페이지</Menu>
        </Menus>
      </Header__upper>
    );
  } else {
    <Header__upper>
      <MainLogo src="../img/new_logo_nobackground.png" alt="Main Logo" />
      <Menus>
        <Menu>클럽 소개</Menu>
        <Menu>이벤트</Menu>
        <Menu>커뮤니티</Menu>
        <Menu>공지 사항</Menu>
        <Menu>문의하기</Menu>
        <Menu>로그인</Menu>
      </Menus>
    </Header__upper>;
  }
}

export default Header;
